import PostList from "./PostList";
import Filter from "./filter/Filter";
import {Button} from "react-bootstrap";

function Main({newSetFilter}) {
    return (
        <div>
            <Button onClick={() => newSetFilter(1, 'test')}>test</Button>
            <Filter setFilter={newSetFilter}/>
            <PostList/>
        </div>
    )
}

export default Main;
